import React, { Component } from 'react';

class FilesNav extends Component {
    render() {
        return (
        
            <div class="d-grid gap-2">
                <label class="btn btn-primary btn-file" input type="file">Кнопка</label>
                <button class="btn btn-primary" type="button">Кнопка</button>
            </div>
        );
    }
}

export default FilesNav;
